import React from 'react'
import styled from 'styled-components'
import Logo from '@components/common/Logo'

const FooterContainer = styled.footer`
  min-height: 20vh;
  padding: 20px;
  color: #fff;
  background-color: #d0c4b8;
`

const Footer = () => {
  const footerButtons = [
    {
      link: '#',
      name: 'tw'
    },
    {
      link: '#',
      name: 'ig'
    },
    {
      link: '#',
      name: 'fb'
    }
  ]

  const footerLinks = [
    {
      links: [
        {
          link: '#',
          name: 'iOS App Store'
        },
        {
          link: '#',
          name: 'Google Play Store'
        }
      ],
      name: 'Download'
    },

    {
      links: [
        {
          link: '#',
          name: 'Privacy Policy'
        },
        {
          link: '#',
          name: 'Terms of Service'
        }
      ],
      name: 'Legal'
    },
    {
      links: [
        {
          link: '#',
          name: 'Contact'
        },
        {
          link: '#',
          name: 'Help/FAQ'
        }
      ],
      name: 'Help'
    }
  ]
  return (
    <FooterContainer>
      <Logo type='footer' />
    </FooterContainer>
  )
}

export default Footer
